# script that performs simple insert from select, but step by step
import sqlite3

db = sqlite3.connect('../out/mal_denorm.db', timeout=20)
db_cursor = db.cursor()

db_cursor.execute("ATTACH DATABASE '../out/mal_dump_source.db' AS mds;", ())

loginToUserCalc = {

}


def collect_with_sql(animeId: int):
    sql = '\n'.join([
        'INSERT INTO trueAnimeList (',
        '/*#1*/malId,',
        '/*#2*/avgAbsScore,',
        '/*#3*/avgAttitude ',
        ')',
        'SELECT ',
        '/*#1*/ua.malId,',
        '/*#2*/AVG(ua.score),',
        '/*#3*/AVG(ua.score - uc.averageScore) ',
        'FROM mds.userAnime ua',
        'JOIN mds.userCalc uc ON uc.login = ua.login',
        'WHERE ua.malId = ?',
        '  AND ua.score > 0',
        'GROUP BY ua.malId',
        ';',
    ])

    db_cursor.execute(sql, (animeId,))
    db.commit()


def collect_next(animeId: int):
    collect_with_sql(animeId)


